(defn average [coll]
  (if (some nil? coll)
    nil
  	(/ (reduce + coll) (count coll))))
(def avg-errors
  (map
    (fn [gen]
      (map
        (fn [ind]
          (average (vals (:traits ind))))
        (:individuals gen)))
    fun-generations))
(second avg-errors)

